text:
{'text': 'Glad to have found an outlet of Brotzeit in the West. Very airy and well ventilated outlet that is smacked in the middle of WestGate. Ordered the main dishes of the Pork Schnitzel, which was quite big and crispy, and the Sausage Platter, which was a good combination balance for a small group of people.

Had a great filling despite initially thinking it may not be sufficient for our group, but was thankful we never over-ordered and it was just nice!

Will definitely come back again in future!', 'languageCode': 'en'}

